/**
 * @file Created on 2019-3-14 取消点赞动画
 * @module ui/cancelPraise
 * @author sunxiaoyu01 <sunxiaoyu01@baidu.com>
 */

import register from '../register';
import {getParams} from '../utils';
import {open} from './index';

register('praise/openCancelPraise', {
    v: 42,
    androidVersionRange: ['11.3.6'],
    iosVersionRange: ['11.3.6'],
    filter() {
        return {
            module: 'praise',
            action: 'cancelPraise'
        };
    }
});
/**
 * @function openCancelPraise
 * @param {Object} [params={}] - 参数
 */
export default (params = {}) => open(getParams('praise-cancelPraise', params));